import {dashboard, expenses, transactions, trend} from '../utils/Icons'
import { useAuth } from '../context/authContext'

export const menuItems = [
    {
        id: 1,
        title: user => user?.name || 'Kullanıcı',
        icon: dashboard,
        link: '/dashboard'
    },
    {
        id: 2,
        title: "İşlemler",
        icon: transactions,
        link: "/dashboard",
    },
    {
        id: 3,
        title: "Gelirler",
        icon: trend,
        link: "/incomes",
    },
    {
        id: 4,
        title: "Giderler",
        icon: expenses,
        link: "/expenses",
    },
]
